	insertDataLoop: function (trans) {
		console.log("insertDataLoop");

		// Obtém o script
		var script = BANCODADOS.listaInsert[BANCODADOS.CountInsertData++];
		
		// Nome da tabela
		var tabela = script.substring("INSERT INTO ".length, script.indexOf("(") - 1);
		
		console.log ("Insert Table: " + tabela);
		trans.executeSql(script, [], BANCODADOS.CountInsertData == BANCODADOS.listaInsert.length ? null : BANCODADOS.insertDataLoop(trans), null);
	},

	prepareInsertData: function (trans) {
		console.log("prepareInsertData");
		BANCODADOS.CountInsertData = 0;
		BANCODADOS.insertDataLoop(trans);
	},
	
