	createTablesLoop: function (trans) {
		console.log("createTablesLoop");

		// Obtém o script
		var script = BANCODADOS.listaCreateTables[BANCODADOS.CountCreateTables++];

		// Nome da tabela
		var tabela = script.substring("CREATE TABLE ".length, script.indexOf("(") - 1);
		
		console.log ("Drop Table: " + tabela);
		trans.executeSql("DROP TABLE IF EXISTS " + tabela, [], function (trans) {
			console.log ("Create Table: " + tabela);
			trans.executeSql(script, [], BANCODADOS.CountCreateTables == BANCODADOS.listaCreateTables.length ? null : BANCODADOS.createTablesLoop(trans), null);
		}, null);
	},

	prepareCreateTables: function (trans) {
		console.log("prepareCreateTables");
		BANCODADOS.CountCreateTables = 0;
		BANCODADOS.createTablesLoop(trans);
	},

